import React from "react";

export default function Sidebar() {
	const [seen, setSeen] = useState(false);
	function toggleSeen() {
		setSeen(!seen);
	}
	return (
		<>
			<button onClick={toggleSeen}>Create Task</button>
			{seen ? <TaskForm toggle={toggleSeen} /> : null}
		</>
	);
}
